			if(parts == null || parts.length != 2){
				return false;
			}
			
			if( /^\d+$/.test(parts[0].replace(" ", "")) == false || (/^\d+$/.test(parts[1].replace(" ", "")) == false)){
				return false;
			}
			
			var mes = parseInt(parts[0]);
			
			if(mes < 1 || mes > 12){
				return false;
			}
			
			var ano = parseInt(parts[1]);
			
			if(ano < 2020 || ano > 2050){
